import React, { useState } from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import "./App.css";
import Cadastro from "./components/Cadastro";
import Home from "./components/Home";
import Charts from "./components/Charts";
import Consulta from "./components/Consulta";

const { Header, Content, Footer, Sider } = Layout;

export default function App() {


  return (
    <>
      <Router>

            <Header
              className="site-layout-background"
              style={{ padding: 0, textAlign: "center" }}
            >
              {" "}
              <h3> CADASTRO E CONSULTA DE OCORRÊNCIAS </h3>
            </Header>
            <Content style={{ margin: "0 16px" }}>
              <Breadcrumb style={{ margin: "20px 0" }} />
              <div
                className="site-layout-background"
                style={{ padding: 24, minHeight: 500 }}
              >
                <Route path="/" exact={true} component={Home} />
                <Route path="/graficos" exact={true} component={Charts} />
                <Route path="/cadastro" exact={true} component={Cadastro} />
                <Route path="/consulta" exact={true} component={Consulta} />
              </div>
            </Content>
            <Footer style={{ textAlign: "center" }}>
              Aplicativo desenvolvido por: Paulo Jonas Alves da Silva
            </Footer>


      </Router>
    </>
  );
}
